import React from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { getDetail } from '../../Redux/actions';
import { Link } from 'react-router-dom';
import { useEffect } from 'react';


export default function Detail(props) {
  console.log(props)
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(getDetail(props.match.params.id));
  }, [dispatch])

  const myDog = useSelector((state) => state.Detail)

  return(

  <div>
    {
        myDog.length > 0 ?
        <div>
            <h1>Soy {myDog[0].name}</h1>
            <img src = {myDog[0].img? myDog[0].img : myDog[0].image} alt="" width='100px' height='100'/>
            <h2>Bred_group: {myDog[0].breed_group}</h2>
            <h3>Temperament: </h3>
            <p>{myDog[0].createdInDB? myDog[0].temperaments.map((el) => el.name).join(", ")
                : myDog[0].temperament}
            </p>
            <h3>Life_span: {myDog[0].life_span}</h3>
            <h4>Weight: </h4>
            <h4>Min: {myDog[0].weight_min}</h4>
            <h4>Max: {myDog[0].weight_max}</h4>
            <h5>Height:</h5>
            <h5>Min: {myDog[0].heigth_min}</h5>
            <h5>Max: {myDog[0].heigth_m}ax</h5>

        </div>: <p>loading...</p>
    }
    <Link to= '/home'>
        <button>Volver</button>
    </Link>
    </div>
    )
}
